import{ useState } from "react";
import axios from "axios";
import { HStack } from "@chakra-ui/react";
import "./App.css";

function App() {
  const url = "http://localhost:8005/questions/:cpf"; // Use correct backend route

  const [searchedCpf, setSearchedCpf] = useState("");
  const [posts, setPosts] = useState([]);
  console.log(posts)

  const handleSearch = async () => {
    try {
      const response = await axios.get(url, { params: { cpf: searchedCpf } }); // Pass CPF as a param
      setPosts(response.data);
    } catch (error) {
      console.error(error);
      alert("Error fetching data! Please try again later.");
    }
  };

  return (
    <div className="App">
      {/* ... rest of your JSX ... */}
      <HStack>
        <input
          type="text"
          placeholder="Enter CPF"
          onChange={(e) => setSearchedCpf(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </HStack>
      {/* ... display fetched posts ... */}
    </div>
  );
}

export default App;
